const LatestOrders = (props) => {
  const data = Object.values(props.data);
  console.log(data);
  return (

  <Card {...props}>
    <CardHeader title="Vital Signs" />
    <Divider />
    <PerfectScrollbar>
      <Box sx={{ minWidth: 800 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>
                Vital Sign
                {props.name}
              </TableCell>
              <TableCell>
                Result
              </TableCell>
              <TableCell sortDirection="desc">
                <Tooltip
                  enterDelay={300}
                  title="Sort"
                >
                  <TableSortLabel
                    active
                    direction="desc"
                  >
                    Date
                  </TableSortLabel>
                </Tooltip>
              </TableCell>
              <TableCell>
                Notes
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((order) => (
              <TableRow
                hover
                key={order.id}
              >
                <TableCell>
                  {order.id}
                </TableCell>
                <TableCell>
                  {order.valueQuantity.value}
                  {order.valueQuantity.unit}
                </TableCell>
                <TableCell>
                  {moment(order.effectiveDateTime).format('DD/MM/YYYY')}
                </TableCell>
                <TableCell>
                  <Chip
                    color="primary"
                    label={order.id}
                    size="small"
                  />
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Box>
    </PerfectScrollbar>
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'flex-end',
        p: 2
      }}
    >
      <Button
        color="primary"
        endIcon={<ArrowRightIcon />}
        size="small"
        variant="text"
      >
        View all
      </Button>
    </Box>
  </Card>
  );
};

export default LatestOrders;
